import { MDBContainer } from "mdbreact";
import { Component } from "react";
import GetService from '../components/apis/get.service';

class DisplayPage extends Component{
    constructor(props){
        super(props);
        this.state={
            //title: props.title,
            objectID: props.match.params.objectID.replace(':','')
        };
        console.log(this.props.match.params.objectID);
        console.log(this.state.objectID);
        this.callDetails=this.callDetails.bind(this);
    }

    componentDidMount() {
        this.callDetails(this.state.objectID);

    }

    callDetails=(objectID)=>{
        console.log("asdadadasd");
        GetService.getInfoDetails(objectID).then((res)=>{
            console.log(res);
            this.setState({
                details: res,
                show:true
            });

        });
    }

    render(){
        let table = null;
        if(this.state.show==true && this.state.details){
            table = this.state.details.map((item, index)=>{
                return(
                <tr key={index}>
                <td>{item['title']}</td>
                <td>{item['area']}</td>
                <td>{item['evidence']}</td>
                <td>{item['note']}</td>
                <td>{item['parent']}</td>
              </tr>
                )
            });
            console.log(table);
        }

        return(
        <div>
            <table class="table-details">
                <thead>
                    <tr>
                      <th>Flurname</th>
                      <th>Area</th>
                      <th>Beleg</th>
                      <th>Note</th>
                      <th>Obergeordnete</th>
                    </tr>
                </thead>
                <tbody>
                    {table}
                </tbody>
                </table>

        </div>


        );
    }
}
export default DisplayPage;
